import React from "react";
import "./App.css";
import axios from "axios";

function App() {
  async function test() {
    const res = await axios.post("http://localhost:3001/auth/register", {
      username: "zane",
      password: "bob123",
    });
    console.log(res.data.token);
  }
  test();
  return <div className="App">hello</div>;
}

export default App;
